package me.ckhd.opengame.online.util.anzhi;import java.io.Serializable;import java.util.List;public class A_Resp implements Serializable{	private static final long serialVersionUID = 1L;		private Integer total;		private String time;		private String msg;		private String sc;		private String st;		private String sign;				public A_Resp(){}		public String getSc() {		return sc;	}	public void setSc(String sc) {		this.sc = sc;	}	public String getSt() {		return st;	}	public void setSt(String st) {		this.st = st;	}	public String getTime() {		return time;	}	public void setTime(String time) {		this.time = time;	}	public String getSign() {		return sign;	}	public void setSign(String sign) {		this.sign = sign;	}	public String getMsg() {		return msg;	}	public void setMsg(String msg) {		this.msg = msg;	}	public Integer getTotal() {		return total;	}	public void setTotal(Integer total) {		this.total = total;	}}